fn generate_modname_to_mask() -> BTreeMap<&'static str, u32> {
  let mut modifiers = BTreeMap::new();
  // following code is generated by:
  //   cat /usr/include/X11/X.h | rg '(Mask|AnyModifier).+\(\d<<\d+\)' | ruby -ne '$_ =~ /#define ((.+)Mask|AnyModifier)\s+\((.+)\)/; name = $2 || $1; value = $3; puts %Q{modifiers.insert("#{name}", #{value});}'
  modifiers.insert("Shift", 1 << 0);
  modifiers.insert("Lock", 1 << 1);
  modifiers.insert("Control", 1 << 2);
  modifiers.insert("Mod1", 1 << 3);
  modifiers.insert("Mod2", 1 << 4);
  modifiers.insert("Mod3", 1 << 5);
  modifiers.insert("Mod4", 1 << 6);
  modifiers.insert("Mod5", 1 << 7);
  modifiers.insert("Button1", 1 << 8);
  modifiers.insert("Button2", 1 << 9);
  modifiers.insert("Button3", 1 << 10);
  modifiers.insert("Button4", 1 << 11);
  modifiers.insert("Button5", 1 << 12);
  modifiers.insert("AnyModifier", 1 << 15);
  // code generation finished
  modifiers
}

